CREATE FUNCTION [dbo].[sq_user_full_name] 
(
	@first as nvarchar(200), @last as nvarchar(200)
)
RETURNS nvarchar(400)
AS

SET TRANSACTION ISOLATION LEVEL SERIALIZABLE;
BEGIN TRANSACTION;

insert into gal_AgeGroup2AgentGroup (agegrp2agtgrp_agent_group_id,agegrp2agtgrp_age_group_id,agegrp2agtgrp_priority)
select agent_group_id, age_group_id, agegrp2agtgrp_priority = 1
from gal_AgentGroups
full outer join gal_AgeGroups on 1=1
left join gal_AgeGroup2AgentGroup on agent_group_id = agegrp2agtgrp_agent_group_id and age_group_id = agegrp2agtgrp_age_group_id
where agegrp2agtgrp_id is null and (select COUNT(*) from gal_AgentGroups) > 0 and (select COUNT(*) from gal_AgeGroups) > 0 

COMMIT TRANSACTION;

SET TRANSACTION ISOLATION LEVEL SERIALIZABLE;
BEGIN TRANSACTION;

insert into gal_CampaignGroup2AgentGroup (cmpgrp2agtgrp_agent_id,cmpgrp2agtgrp_campaign_id)
select agent_group_id, campaign_group_id
from gal_AgentGroups
full outer join gal_CampaignGroups on 1=1
left join gal_CampaignGroup2AgentGroup on agent_group_id = cmpgrp2agtgrp_agent_id and campaign_group_id = cmpgrp2agtgrp_campaign_id
where cmpgrp2agtgrp_id is null and (select COUNT(*) from gal_AgentGroups) > 0 and (select COUNT(*) from gal_CampaignGroups) > 0 

COMMIT TRANSACTION;

SET TRANSACTION ISOLATION LEVEL SERIALIZABLE;
BEGIN TRANSACTION;

insert into gal_StateGroup2AgentGroup (stgrp2agtgrp_agent_id,stgrp2agtgrp_state_id,stgrp2agtgrp_priority)
select agent_group_id, state_group_id, stgrp2agtgrp_priority = 99
from gal_AgentGroups
full outer join gal_StateGroups on 1=1
left join gal_StateGroup2AgentGroup on agent_group_id = stgrp2agtgrp_agent_id and state_group_id = stgrp2agtgrp_state_id
where stgrp2agtgrp_id is null and (select COUNT(*) from gal_AgentGroups) > 0 and (select COUNT(*) from gal_StateGroups) > 0 

COMMIT TRANSACTION;

